import React from 'react';
const api={
key: "86d5c240f3197d83bbebe37ad053b999",
base: "https://api.openweathermap.org/data/2.5/"
}

function App() {
  return (
    <div className="app">
      <main>
        <div className="search-box">
          <input
          type="text"
          className="search-bar"
          placeHolder="Search..."
          />
        </div>
      </main>
    </div>
  );
}

export default App;
